import React, { Component } from 'react';
import './Styles/Collections.css';
import './Styles/topic.css';

class Collection extends Component {
  render() {
    const { collectionsData, show } = this.props;
    return (
      <>
        <div className="collections-wrapper">
          {show && <p className='topic'>خاص ترین شهرهای ایران برای سفر:</p>}
        </div>
        <div className="cards-wrapper">
          {collectionsData &&
            collectionsData.map(({ url, id, description }) => (
              <CollectionCard key={id} url={url} description={description} />
            ))}
        </div>
      </>
    );
  }
}

class CollectionCard extends Component {
  render() {
    const url = `url(${this.props.url})`;
    return (
      <div className="collection-card-wrapper">
        <div className="card-parent">
          <div
            className="card-child"
            style={{
              backgroundImage: url
            }}
          >
            <p>{this.props.description}</p>
          </div>
        </div>
      </div>
    );
  }
}

export default Collection;
